design.custom_css:
.hustle-layout .hustle-title {
    text-shadow: 1px 1px 1px #fff;
}
.hustle-layout .hustle-subtitle {
    margin-top: -8px;
    text-shadow: 1px 1px 1px #fff;
}
.hustle-layout .hustle-group-content hr {
    margin: 19px 0 20px;
    padding: 0;
    border: 0 solid #222;
    border-top-width: 1px;
}
.hustle-layout .hustle-group-content hr:first-child {
    margin-top: 0;
}
.hustle-layout .hustle-group-content hr:last-child {
    margin-bottom: 0;
}
.hustle-layout .hustle-group-content h3 {
    margin: 0;
    color: #fff;
    text-shadow: 2px 2px 0 rgba(0,0,0,0.25);
}
@media screen and (max-width: 782px) {
    .hustle-layout  .hustle-image {
        top: -50px;
        margin-bottom: -50px;
    }
}
